script: |
  super -f text -I q6802.spq | sort > q6802.out

inputs:
  - name: q6802.spq
    data: |
      SELECT DISTINCT + 78 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col2 + - col0 BETWEEN + col2 * - col2 + + - col2 + - col2 * + 91 AND NULL OR 39 IS NULL;
  - name: tab0

outputs:
  - name: q6802.out
    data: |
